INSERT INTO `recruit_company_info` VALUES (1, '国家电网', '成都', '13184523478', 'http://localhost:8080/profile/upload/2023/04/25/dc80b3dc-7574-4159-8d4c-2cc5eef38705.jpg', 'http://localhost:8080/profile/upload/2023/04/24/3137f6f6-456b-4c12-8749-fc2c890a05e6.png', 1, '中国国家电网公司（简称国家电网）成立于2002年，是中国最大的电力生产、传输和配电企业之一，也是世界上最大的电力公司之一。国家电网负责中国电力系统的运行、规划和建设，拥有超过1600万千瓦的发电能力，约占全国总发电能力的44%。', 2, 0, 105);
INSERT INTO `recruit_company_info` VALUES (2, '四川路桥', '成都', '13184523478', 'http://localhost:8080/profile/upload/2023/04/25/9c4f0170-8f55-4bf9-ad91-f6251d303fb4.jpg', 'http://localhost:8080/profile/upload/2023/04/24/7590e495-63fe-40f4-aab9-df2692f9be82.png', 1, '中国四川路桥股份有限公司是中国领先的基础设施建设企业之一，成立于1951年，总部位于四川省成都市。公司主营业务包括道路、桥梁、隧道、机场等基础设施建设以及房地产开发等领域。公司拥有强大的技术团队和丰富的施工经验，已参与了大量国内外重大工程项目的建设。', 2, 0, 103);
INSERT INTO `recruit_company_info` VALUES (3, '国信集团', '成都', '13184523478', 'http://localhost:8080/profile/upload/2023/04/25/9a89977e-e615-41d5-a34c-c3fc99b16b83.jpg', 'http://localhost:8080/profile/upload/2023/04/25/c2d86f16-f186-42d4-9f9f-59f905184c8a.png', 1, '中国国信集团是中国的一家大型国有企业，成立于1997年，总部位于北京。公司业务涵盖信息通信、金融、房地产、能源等多个领域，在国内外拥有广泛的业务网络和客户群体。', 2, 0, 106);
INSERT INTO `recruit_company_info` VALUES (4, '中国电信', '成都', '13184523478', 'http://localhost:8080/profile/upload/2023/04/25/4b6cf693-a6c7-407b-bd36-8fe2f548478c.jpg', 'http://localhost:8080/profile/upload/2023/04/24/bb836a6d-45c9-454b-b9cd-77d3eb8281c5.png', 1, '中国电信集团公司是中国大陆的一家国有电信运营商，成立于2002年，总部位于北京。公司业务涵盖固定电话、移动电话、宽带接入等领域，在全国范围内拥有广泛的业务覆盖和客户群体。中国电信还积极推进5G网络建设，同时也在物联网、云计算等新兴领域展开业务布局。', 2, 0, 2);
INSERT INTO `recruit_company_info` VALUES (5, '中国中铁', '成都', '13184523478', 'http://localhost:8080/profile/upload/2023/04/25/12639a63-2c36-43b6-a138-c3cf4c541d61.jpg', 'http://localhost:8080/profile/upload/2023/04/24/e0503c4d-ac61-4fd2-9c72-928bf99a6324.png', 1, '中国中铁集团有限公司是中国大陆的一家国有企业，成立于2007年，总部位于北京。公司主要从事铁路、公路、城市轨道交通等基础设施建设和运营管理业务，在国内外拥有广泛的业务网络和客户群体。中国中铁集团是世界上最大的铁路工程施工企业之一，也是中国基础设施建设领域的重要力量。', 2, 0, 5);
INSERT INTO `recruit_company_info` VALUES (6, '中国烟草', '成都', '13184523478', 'http://localhost:8080/profile/upload/2023/04/25/26000e26-d7e6-4192-bd06-bcae208a7ceb.jpg', 'http://localhost:8080/profile/upload/2023/04/25/9f5664ea-4570-4a8a-bf5e-654574037dfa.png', 1, '中国烟草公司是中国的国有烟草生产和销售企业，成立于1982年，总部位于北京。公司是中国烟草行业的领军企业，拥有众多烟草品牌和品种，是全球最大的烟草生产和销售企业之一。尽管面临着健康风险和社会压力等问题，中国烟草公司仍然在国内外市场上保持着强劲的竞争力和市场占有率。', 2, 0, 4);
INSERT INTO `recruit_company_info` VALUES (8, '四川九州', '成都', '18250014239', 'http://localhost:8080/profile/upload/2021/05/09/ac6dd529-ebec-4fcc-9cda-0a00079faa0e.jpg', 'http://localhost:8080/profile/upload/2021/05/09/6384a9d3-50dc-4a55-884c-31206dafb821.jpg', 1, '四川九州集团股份有限公司是一家总部位于四川省成都市的化工企业，成立于1994年，是中国领先的氯碱化工生产企业之一。公司主要从事氯碱化工、塑料制品等领域的生产和销售，拥有多个子公司和生产基地，业务范围遍及全国各地以及部分海外市场。四川九州公司致力于提高产品质量和技术水平，积极推进绿色环保和可持续发展。', 2, 0, 101);
