INSERT INTO `recruit_company_info` VALUES (16, '工商银行', '成都', '15080238167', 'http://localhost:8080/profile/upload/2021/06/09/eb35f89f-986b-495c-af06-cc8bce8b7051.jpg', 'http://localhost:8080/profile/upload/2021/06/09/6e1ebe10-426a-48c1-972b-804d18e28f95.jpg', 1, '博思是一家平台型软件及信息化服务提供商，应用自主研发的“灵动业务架构平台（LiveBOS）”，为包括证券、期货、银行、电子交易市场等在内的金融行业及其他行业提供以业务流程管理（BPM）为核心、以“互联网+”应用为重点方向的信息化解决方案。', 2, 0, 171);
INSERT INTO `recruit_company_info` VALUES (17, '南方电网', '成都', '15080239188', 'http://localhost:8080/profile/upload/2021/06/10/db4b844f-e8b6-44c8-8716-e8a86b06c097.jpg', 'http://localhost:8080/profile/upload/2021/06/10/fd37efa5-66e6-4b4b-8e96-a1efa842dd35.jpg', 1, '顶点科技强调“客户、员工与股东”的共同发展与进步，\n对外，追求为客户创造价值，与客户的共同发展；\n对内，追求员工与公司的共同进步，努力实现员工个人发展与企业长远发展的和谐统一。未来，顶点软件将通过深入挖掘客户需求，结合创新的思维与技术，实现“软件科技超越客户梦想”的追求，使顶点软件成为国内一流的软件企业，成为让客户、员工、股东以及社会所信赖并敬重的企业。\n', 2, 0, 172);
