INSERT INTO `recruit_lecture` VALUES (13, '“阳光再就业计划”——成都市老年人再就业培训。', '成都市锦江区人民南路四段88号', '为了积极响应国家老龄事业发展战略，推进老年人就业再培训工作，成都市人力资源和社会保障局特别组织开展了老年人再就业培训活动。\n\n本次培训旨在提高老年人的职业技能水平，增强就业能力，更好地适应现代社会对人才的需求。具体培训内容包括但不限于：电脑基础操作、互联网应用、办公软件使用、营销技巧等方面的知识。', '86073227', '计算机', '2023-05-08 00:00:00', '成都市老年人活动中心', 1, NULL);
INSERT INTO `recruit_lecture` VALUES (14, '“艺术人生”——成都市老年人手工艺术培训计划。', '成都市青羊区黄田坝街88号', '尊敬的老年朋友们：\n\n为了满足老年朋友们对手工艺术的热爱和需求，成都市文化和旅游局特别组织了一次手工艺术培训活动。\n\n本次培训将涵盖中国传统手工艺术、剪纸、刺绣、陶艺、绘画等方面的知识和技能，培训将由专业的老师授课，帮助老年朋友们全面掌握手工艺术的制作技巧和知识，提高自身审美和艺术修养。', '86069258', '传统手工艺术', '2023-05-20 00:00:00', '成都市文化艺术中心', 1, NULL);
