INSERT INTO `sys_oper_log` VALUES (1038, '招聘岗位', 2, 'com.ruoyi.recruit.controller.RecruitPositionController.edit()', 'PUT', 1, 'admin', NULL, '/recruit/position', '127.0.0.1', '内网IP', '{\"validDate\":1619625600000,\"phonenumber\":\"15200632969\",\"auditState\":1,\"workCity\":\"成都市\",\"company\":{\"address\":\"成都\",\"nature\":1,\"phonenumber\":\"13184523478\",\"description\":\"中国烟草公司是中国的国有烟草生产和销售企业，成立于1982年，总部位于北京。公司是中国烟草行业的领军企业，拥有众多烟草品牌和品种，是全球最大的烟草生产和销售企业之一。尽管面临着健康风险和社会压力等问题，中国烟草公司仍然在国内外市场上保持着强劲的竞争力和市场占有率。\",\"hot\":0,\"params\":{},\"auditState\":2,\"license\":\"http://localhost:8080/profile/upload/2023/04/25/9f5664ea-4570-4a8a-bf5e-654574037dfa.png\",\"name\":\"中国烟草\",\"logo\":\"http://localhost:8080/profile/upload/2023/04/25/26000e26-d7e6-4192-bd06-bcae208a7ceb.jpg\",\"id\":2},\"id\":2,\"quantity\":5,\"releaseDate\":1573056000000,\"requirement\":\"工作经验：十年以上工作经验。\\nJava技术栈：熟练掌握Java语言及其相关技术，包括Spring、Hibernate、MyBatis等框架，熟悉JVM原理和性能优化。\\n\\n架构设计：具备扎实的架构设计能力，能够根据业务需求提出合理的系统架构设计方案，包括技术选型、系统拆分、模块划分等。\\n\\n微服务架构：熟悉微服务架构，能够设计和实现分布式系统，了解服务治理、负载均衡、服务注册与发现等相关技术。\\n\\n高可用和高并发：具备高可用和高并发系统的设计和实现经验，能够解决系统的瓶颈和性能问题，熟悉常见的高可用和高并发技术，如集群、负载均衡、缓存等。\\n\\n数据库设计：熟悉数据库设计和调优，能够设计出合理的数据模型，熟悉SQL语言和常见的数据库技术，如MySQL、Oracle、Redis等。\\n\\nDevOps：熟悉DevOps相关技术，如自动化部署、持续集成、持续交付等，具备基础的Linux系统操作和维护能力。\\n\\n团队管理：有一定的团队管理经验，能够带领团队完成项目开发，并对团队成员进行培养和管理。\\n\\n沟通能力：具备良好的沟通能力，能够与业务人员、项目经理、开发团队以及其他相关人员进行良好的沟通。\",\"params\":{},\"companyId\":6,\"salaryDown\":15000,\"name\":\"Java高级架构师\",\"category\":{\"params\":{},\"categoryName\":\"Java\",\"parentId\":1,\"parentCategory\":{\"description\":\"计算机类\",\"params\":{},\"categoryName\":\"计算机(it类-开发＼应用)\"},\"id\":8},\"categoryId\":8,\"salaryUp\":20000,\"status\":0}', '{\"msg\":\"操作成功\",\"code\":200}', 0, NULL, '2023-05-16 00:10:45');
