INSERT INTO `sys_oper_log` VALUES (1043, '讲座申请', 2, 'com.ruoyi.recruit.controller.RecruitLectureController.edit()', 'PUT', 1, 'admin', NULL, '/recruit/lecture', '127.0.0.1', '内网IP', '{\"companyName\":\"“阳光再就业计划”——成都市老年人再就业培训。\",\"direct\":\"成都市人力资源和社会保障局培训中心（成都市锦江区人民南路四段88号）。\",\"description\":\"为了积极响应国家老龄事业发展战略，推进老年人就业再培训工作，成都市人力资源和社会保障局特别组织开展了老年人再就业培训活动。\\n\\n本次培训旨在提高老年人的职业技能水平，增强就业能力，更好地适应现代社会对人才的需求。具体培训内容包括但不限于：电脑基础操作、互联网应用、办公软件使用、营销技巧等方面的知识。\",\"classroom\":\"成都市老年人活动中心\",\"params\":{},\"auditState\":1,\"phone\":\"请老年朋友们自行前往成都市人力资源和社会保障局培训中心报名，或者拨打报名咨询电话：028-12345678。\",\"companyAddress\":\"四川省成都市锦江区东升街90号\",\"startTime\":1683475200000,\"id\":13}', 'null', 1, '\r\n### Error updating database.  Cause: com.mysql.cj.jdbc.exceptions.MysqlDataTruncation: Data truncation: Data too long for column \'phone\' at row 1\r\n### The error may exist in file [C:\\Users\\24557\\Desktop\\毕业设计\\Elder_Manage\\Project_elder\\recruit\\root-recruit\\target\\classes\\mapper\\recruit\\RecruitLectureMapper.xml]\r\n### The error may involve com.ruoyi.recruit.mapper.RecruitLectureMapper.updateRecruitLecture-Inline\r\n### The error occurred while setting parameters\r\n### SQL: update recruit_lecture          SET company_name = ?,             company_address = ?,             phone = ?,             description = ?,             direct = ?,             classroom = ?,             start_time = ?,             audit_state = ?          where id = ?\r\n### Cause: com.mysql.cj.jdbc.exceptions.MysqlDataTruncation: Data truncation: Data too long for column \'phone\' at row 1\n; Data truncation: Data too long for column \'phone\' at row 1; nested exception is com.mysql.cj.jdbc.exceptions.MysqlDataTruncation: Data truncation: Data too long for column \'phone\' at row 1', '2023-05-16 00:24:25');
